CREATE TABLE LABELS (
	ID INTEGER NOT NULL,
	SKILL_ID INTEGER,
	ABILITY_ID INTEGER,
	LABEL VARCHAR(100) NOT NULL,
	CREATED_BY VARCHAR(100) DEFAULT 'admin' NOT NULL,
	CREATION_DATE DATE DEFAULT CURRENT_DATE NOT NULL,
	LAST_UPDATED_BY VARCHAR(100) DEFAULT 'admin' NOT NULL,
	LAST_UPDATE_DATE DATE DEFAULT CURRENT_DATE NOT NULL,
	CONSTRAINT LABELS_PK PRIMARY KEY (ID),
	CONSTRAINT LABELS_ABILITY_FK FOREIGN KEY (ABILITY_ID) REFERENCES ABILITIES(ID),
	CONSTRAINT LABELS_SKILL_FK FOREIGN KEY (SKILL_ID) REFERENCES SKILLS(ID)
);

